1. S→NT49 NT35: NT49 can only begin with terminals in {t8,t2,t0,t6,t5,t3,t4}  
2. S→NT36 NT32: NT36 can only begin with {t1,t4,t3,t5,t6}  
3. S→NT20 NT53: NT20 can only begin with {t7,t8}

None of these can begin with t9, so the given string (which starts with t9) cannot be generated.  
